using System;
using System.Collections.Generic;
using System.Linq;
using System.Runtime.InteropServices.WindowsRuntime;
using System.Text;

namespace AdventOfCode
{
  public class Puzzle05
  {
    public static void Run1()
    {
      var polymer = Input();

      var newPolymer = new StringBuilder();

      var lastCharacter = ' ';
      foreach (var character in polymer)
      {
        if (character.ToString().ToLower() == lastCharacter.ToString().ToLower() && character != lastCharacter)
        {
          newPolymer = newPolymer.Remove(newPolymer.Length - 1, 1);
          lastCharacter = newPolymer.Length == 0 ? ' ' : newPolymer.ToString().Last();
        }
        else
        {
          newPolymer.Append(character);
          lastCharacter = character;
        }
      }
      polymer = newPolymer.ToString();

      Console.WriteLine(polymer.Length);
    }

    public static void Run2()
    {
      var distinctCharacters = Input().Select(o => Convert.ToChar(o.ToString().ToLower())).Distinct().ToDictionary(o => o, o => 0);

      var keys = distinctCharacters.Keys.ToList();

      foreach (var key in keys)
      {
        var newPolymer = new StringBuilder();
        var trimmedPolymer = Input().Replace(key.ToString(), string.Empty).Replace(key.ToString().ToUpper(), string.Empty);
        var lastCharacter = ' ';
        foreach (var character in trimmedPolymer)
        {
          if (character.ToString().ToLower() == lastCharacter.ToString().ToLower() && character != lastCharacter)
          {
            newPolymer = newPolymer.Remove(newPolymer.Length - 1, 1);
            lastCharacter = newPolymer.Length == 0 ? ' ' : newPolymer.ToString().Last();
          }
          else
          {
            newPolymer.Append(character);
            lastCharacter = character;
          }
        }
        distinctCharacters[key] = newPolymer.ToString().Length;
      }

      Console.WriteLine(distinctCharacters.Values.Min());
    }

    private static string Input()
    {
      return @"";
    }
  }
}
